this is your gentle reminder to please get your vaccines if you are eligible. this thing is not yet over ! sharing some info because i care and if i can, i’d like to help anybody who is hesitant or curious with making their decision. this delta variant is very new and since data is changing all the time, i’ll source some links for you to stay up to speed yourself but so far... we do know that it spreads much more easily compared to previous variants. most of the spread is among unvaccinated people and in areas with low vaccination rates ! and yes although you can still get it while vaccinated, the vaccine helps to protect against severe illness, hospitalization, and death ! all great things to be protected against in my book. oh and if you have already gotten sick with COVID-19, you should STILL get vaccinated !
for more information especially on some of the Covid myths that are circulating the internet, go to https://www.hopkinsmedicine.org/health/conditions-and-diseases/coronavirus/covid-19-vaccines-myth-versus-fact please and reassure yourself why getting vaxxed is the move. save a life or two. who knows. some helpful accounts that i love following are: @niniandthebrain @jessicamalatyrivera @itsmadetosave
